const productSchema = new Schema({
    handle: String, 
    title: String,
    description: String, 
    sku: Number, 
    grams: Number, 
    stock: Number, 
    price: Number,
    compare: Number,
    barcode: Number
}, {
    timestamps: true,
    versionKey: false
})

export default model('product', productSchema);

